import React from 'react'
import { Home } from 'lucide-react';
function Sidebar() {
  return (
    <div className= 'bg-[#1c1b23] sidebar overflow-scroll md:m-[1rem] m-[0.2rem] h-[95vh] md:w-[20vw] '>
      <div>
      <List link="/" effect="slideUp">
                <Home /> Home
            </List>
      </div>
    </div>
  )
}

export default Sidebar
